import { setBorderRadius } from './border-radius';
export const setOverflowHidden = ({ ctx, rect, borderRadius, overflowHidden, }) => {
    if (!overflowHidden) {
        return () => { };
    }
    return setBorderRadius({
        ctx,
        rect,
        borderRadius,
        forceClipEvenWhenZero: true,
    });
};
